    //     })
    // }, [])
    useEffect(() => {
        setLoading(true)
        axios.get("http://localhost:8000/tenantdata")
        .then(response =>{
            setTenants(response.data)
            console.log("response----",response);
            setLoading(false)
        } )
    },[])

  return (
 <div className="App">
        <>
          <h1>Tenants</h1>
          <table border={1}>
            <tr>
              <th>Tenant ID</th>
              <th>Tenant</th>
              <th>Type</th>
              <th>User Id</th>
            </tr>
           {loading ? <>Loading...</>
           :
           <tbody>
            {tenants.map(item => (
                <tr>
                    <td>{item.id}</td>
                    <td>{item.tenant}</td>
                    <td>{item.type}</td>
                    <td>{item.useid}</td>
                </tr>
            ))}
           </tbody>
           }
          </table>
        </>

    </div>
  )

